import { useState } from "react"

export const Faq = ()=>{
    const [isOpened,setIsOpen] = useState(false)
    return(
        <>
            <div className={ `w-full h-16  border-b border-black border-opacity-50 transition-all ease-in-out duration-300 ${isOpened ? " translate-y-[-30px] " :" translate-y-0"}`}>
                <div className="flex justify-between  p-4 items-center">
                        <h1 className="font-manrope text-black tracking-tighter text-xl md:text-2xl font-bold">
                                What is Airbnb and how does it work?
                        </h1>
                    {
                        !isOpened ?
                        <div onClick={()=>setIsOpen(true)}>
                            <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 32 32" 
                            style={{display:"block",fill:"none",height:"16px",stroke:"black", strokeWidth:"4",overflow:"visible"}}
                           aria-hidden="true" role="presentation" focusable="false"><path fill="none" d="M28 12 16.7 23.3a1 1 0 0 1-1.4 0L4 12"></path></svg>
                        </div>
                        :
                        <div onClick={()=>setIsOpen(false)}>
                                 style={{display:"block",fill:"none",height:"16px",stroke:"black", strokeWidth:"4",overflow:"visible"}}

                            <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 32 32" aria-hidden="true" role="presentation" focusable="false"><path fill="none" d="M4 20 15.3 8.7a1 1 0 0 1 1.4 0L28 20"></path></svg>
                        </div>
                    }
                    </div>
                </div>
                            
        </>
    )
}
